window.bookSummaryJSON = "<p>There's something creeping around in the basement. And it has tentacles.&nbsp;</p> <p>Sam's job as a parking attendant has always been boring. Until now. A hole straight to hell has opened up and evil lurks in the shadows of the garage. When management fails to help, Sam turns to her friends and coworkers.&nbsp;</p> <p>But, can a handful of burned-out employees save a city? Will Sam discover the secret of the parking garage without getting fired, or will she die trying?&nbsp;</p> <p>Find out in...<i>Cthulhu's Car Park. </i></p> <p>This horror novella contains strong language and some violence. Also, slime. Lots of slime.</p>"; 
